import Cities from '../cities.json';
import '../style1.css';
import '../style.css';
import React , {Component} from 'react';

class Ul extends Component{ 
    //البناء
constructor(){
super()

this.state = {
    pageNamer: [] ,
    Citieslength: Cities.length ,


    }
    


}







 //الكتابه

render(){
    for (var a = 1 ; a <= this.state.Citieslength /  5  ; a++ ){
    this.state.pageNamer.push(<li id="pagintion-li" key={a}>{a}</li>)

    }
   
    
    
return(
        <div>
        <ul id="pagintion-ul">
            {this.state.pageNamer}
        </ul>
        </div>
    )}
}
class Table extends Ul  {
//البناء
constructor(){
super()
this.state = {
    mm : 1
     
}


}






 //الكتابه 
render() {


    return(
        <div>
            <table id="table" >
            <tbody>    
                <tr>
            <td  >المدن</td>
            <td >عدد السكان</td>
                </tr>
        {Cities.map(function data(d) {
        
        
            return(
        
                <tr key={d.id} >
                    <td >{d.citie}</td>
                    <td >{d.peples}</td>
                    <td>
                    <button > تعديل </button> 
                    <button  id = "delet"> حدف  </button> 
                    </td>
                </tr>
                    )   
                })}
            </tbody>
            </table>
            <Ul/>
        </div>
            )

}
}
export default Table;
